,'2011-04-28 09:11:09',3,0),(421,2,16,3,NULL,NULL,'asdfasdf','sdfasdfasdf',0,'PostEvent','2011-04-28 09:12:08','2011-04-28 09:16:42','glitterimagesanimals2.gif','image/gif',27029,'2011-04-28 09:12:04',8,0),(422,2,3,3,NULL,'','sdfsdfasdf','asdfasdfasdf',0,'PostProject','2011-04-28 09:25:33','2011-04-28 09:25:33','jsboulanger-feedback-a332d7a.tar.gz','application/x-gzip',14756,'2011-04-28 09:25:33',0,0),(423,2,16,3,NULL,NULL,'asfasfsf','asdfasdfasd',0,'PostEvent','2011-04-28 09:27:45','2011-05-09 10:19:51','images.jpg','image/jpeg',8926,'2011-04-28 09:27:45',2,0),(425,2,14,3,NULL,NULL,'Pho 24 Ho Chi Minh City','Pho is, of course, a favorite dish in Vietnam and one you’ll find listed on almost every restaurant menu. It is fun, however, to eat in a restaurant that features the national dish. Pho 24 is actually a chain that feels somewhat like a fast food restaurant  except the quality of the pho – highlighted with the flavors of clove, anise, and ginger – is far above what you’d come to expect from a quick stop. Pho is a favorite dish all day long – including breakfast.\r\n\r\nAre you hungry yet? We are! Pack your bags and hop on the first flight to Vietnam. No matter what city you end up in you’re bound to find a spectacular local restaurant serving spectacular Vietnamese fare. Make sure you give it a try! ',0,'PostFood','2011-05-03 09:37:50','2011-05-03 09:51:25','pho-24.jpg','image/jpeg',57435,'2011-05-03 09:37:50',1,0),(426,2,14,3,NULL,NULL,'Bun Cha – Hanoi','In the city of Hanoi you’ll find Bun Cha, a restaurant named after its signature dish. Bun cha features a barbecue flavored pork ball served with a fish sauce on the side. You’ll have your choice of additional sides including bean sprouts, morning glory, mint, lettuce – or whatever the vendor across the street has to give the chef that day. This is an incredible lunchtime dish and if you don’t arrive early enough you may not get to try it. Make sure you ask the concierge at your hotel in Hanoi for directions!',0,'PostFood','2011-05-03 10:12:04','2011-05-06 03:38:47',NULL,NULL,NULL,NULL,1,0),(427,2,14,3,NULL,NULL,'Toàn cảnh vụ tiêu diệt Bin Laden','Nơi ẩn náu của Osama bin Laden nằm sâu trong nội địa Pakistan, không phải vùng đối núi hiểm trở giáp biên giới Afghanistan như phỏng đoán. Biệt kích Mỹ lặng lẽ tấn công và tiêu diệt trùm khủng bố Al-Qaeda trước sự theo dõi trực tiếp từ Washington, trong khi giới chức nước chủ nhà Pakistan không hề hay biết cho đến khi chiến dịch đã hoàn tất.',0,'PostFood','2011-05-04 02:23:41','2011-05-04 04:37:59',NULL,NULL,NULL,NULL,1,0),(428,2,5,3,1,'2year','\'Lạm phát cao hơn vì kỳ vọng của người dân\'Điều đáng quan tâm là trong dân chúng luôn thường trực tâm lý kỳ vọng giá còn tăng cao hơn nữa, đặc biệt là khi nền kinh tế đối mặt với lạm phát. Trong lĩnh vực tiền tệ, do lo sợ mất giá, những người có tiền đồng','Điều đáng quan tâm là trong dân chúng luôn thường trực tâm lý kỳ vọng giá còn tăng cao hơn nữa, đặc biệt là khi nền kinh tế đối mặt với lạm phát. Trong lĩnh vực tiền tệ, do lo sợ mất giá, những người có tiền đồng trong tay lại chuyển hóa tích trữ sang các dạng tài sản khác như vàng hay đôla Mỹ, tỷ giá đồng Việt Nam và đôla Mỹ vì thế càng chịu sức ép nhiều hơn. Cùng lúc đó, người có hàng hóa như nông dân cũng mong hàng hóa của mình sẽ còn được giá hơn. Một vòng xoay luẩn quẩn là giá càng cao, người ta càng kỳ vọng nó còn cao hơn nữa. Giá lương thực tăng cao sẽ khiến lạm phát tăng cao hơn.',0,'PostQa','2011-05-04 03:51:48','2011-05-04 03:51:48',NULL,NULL,NULL,NULL,0,0),(429,2,5,3,NULL,'','\'Lạm phát cao hơn vì kỳ vọng của người dân\'Điều đáng quan tâm là trong dân chúng luôn thường trực tâm lý kỳ vọng giá còn tăng cao hơn nữa, đặc biệt là khi nền kinh tế đối mặt với lạm phát. Trong lĩnh vực tiền tệ, do lo sợ mất giá, những người có tiền đồng','test',0,'PostQa','2011-05-04 05:03:31','2011-05-24 03:22:51',NULL,NULL,NULL,NULL,4,0),(430,2,14,3,NULL,NULL,'Dung Nơi ẩn náu của Osama bin Laden nằm sâu trong nội ','Nơi ẩn náu của Osama bin Laden nằm sâu trong nội ',0,'PostFood','2011-05-04 07:00:54','2011-05-20 03:21:26',NULL,NULL,NULL,NULL,1,0),(431,2,14,3,NULL,NULL,'dung “Chôn” xác Bin Laden dưới biển là sai lầm lớn của Mỹ?','Rõ ràng là quyết định trên của Mỹ đã khiến một số học giả Hồi giáo chỉ trích kịch liệt, bởi họ cho rằng một cuộc chôn cất trên biên không không hề đúng với đạo Hồi. Ngoài ra, còn có những dấu hiệu khác cho thấy hình thức “chôn cất” trên có thể làm gia tăng nghi ngờ, đặc biệt là trong giới phê bình Tổng thống Obama, liệu bin Laden có thực sự bị tiêu diệt.',0,'PostFood','2011-05-04 07:41:50','2011-05-06 08:46:03',NULL,NULL,NULL,NULL,2,0),(432,2,14,3,NULL,NULL,'The Food of Vietnam - Vietnamese Food','Increasingly famous worldwide with restaurants sprawled over the globe, yet no Vietnamese food abroad can equal in flavor or quality to that made in Vietnam itself. In brief, Vietnamese cuisine depends heavily on rice grown in water paddies throughout the country, with dishes varying from simple everyday meals to most complex dishes designed for the King. Reaching a balance between fresh herbs and meats; as well as a selective use of spices to reach a fine taste, Vietnamese food can be considered one of the healthiest yet most divine cuisines worldwide.',0,'PostFood','2011-05-05 02:51:54','2011-05-06 03:37:59',NULL,NULL,NULL,NULL,4,0),(433,2,12,3,NULL,'','test attach file test lai','test',0,'PostTeamup','2011-05-05 04:41:31','2011-05-12 08:50:21',NULL,NULL,NULL,NULL,3,0),(434,2,14,3,NULL,NULL,'test due datest','teset',0,'PostFood','2011-05-06 03:44:01','2011-05-06 03:44:01',NULL,NULL,NULL,NULL,0,0),(435,2,9,3,NULL,NULL,'test attach file test lai','test',0,'PostParty','2011-05-06 05:02:36','2011-05-06 05:02:36','images.jpg','image/jpeg',8926,'2011-05-06 05:02:35',0,0),(436,2,9,3,NULL,NULL,'EXIMBANK RA MẮT THẺ EXIMBANK -VISA PLATINUM','Nhằm đáp ứng các nhu cầu ngày càng cao của các doanh nhân, nhà quản lý cấp cao, ngày 06/05/2011 Eximbank đã triển khai sản phẩm thẻ Eximbank-Visa Platinum, d