hơn 2.488 km2 được thăm dò theo quy hoạch. Phần diện tích còn lại được điều tra sơ lược và dự báo tài nguyên.',0,'PostAssignment','2011-05-09 02:25:36','2011-06-22 06:10:36',NULL,NULL,NULL,NULL,2,1),(447,2,1,3,NULL,'','Bắt 6 đối tượng vụ giết giám đốc doanh nghiệp','Chiều 8/5, ông Phạm Xuân Trường, quyền Chánh văn phòng Công an Công an tỉnh Bình Dương cho hay, liên quan đến vụ ông Phan Văn Lan (40 tuổi, ngụ phường Định Hòa, thị xã Thủ Dầu Một) bị sát hại tại nhà, cơ quan cảnh sát điều tra công an tỉnh Bình Dương đã khởi tố vụ án “Giết người”.\r\nVụ án đã được Phòng cảnh sát điều tra tội phạm về trật tự xã hội (PC45) công an tỉnh Bình Dương thụ lý. Thông qua đấu tranh khai thác, đến thời điểm hiện tại Phòng PC45 đã bắt giữ 6 đối tượng liên quan đến vụ án kể cả nghi can bị người dân bắt giữ tại hiện trường.',0,'PostAssignment','2011-05-09 02:49:19','2011-05-09 02:49:19',NULL,NULL,NULL,NULL,0,1),(448,2,1,3,NULL,'','test','test',0,'PostAssignment','2011-05-09 03:00:25','2011-05-09 03:00:25',NULL,NULL,NULL,NULL,0,1),(449,2,1,3,NULL,'','test','test',0,'PostAssignment','2011-05-09 03:01:50','2011-05-09 03:01:50',NULL,NULL,NULL,NULL,0,1),(450,2,1,3,NULL,'','test','test',0,'PostAssignment','2011-05-09 03:09:09','2011-05-09 03:09:09',NULL,NULL,NULL,NULL,0,1),(451,2,1,3,NULL,'','test','test',0,'PostAssignment','2011-05-09 03:11:59','2011-05-09 03:11:59',NULL,NULL,NULL,NULL,0,1),(452,2,1,3,NULL,'','test','test',0,'PostAssignment','2011-05-09 03:13:53','2011-05-09 03:13:53',NULL,NULL,NULL,NULL,0,1),(453,2,1,3,NULL,'','test','test',0,'PostAssignment','2011-05-09 03:15:34','2011-05-09 03:15:34',NULL,NULL,NULL,NULL,0,1),(454,2,1,3,NULL,'','test','test',0,'PostAssignment','2011-05-09 03:19:18','2011-05-09 03:19:18',NULL,NULL,NULL,NULL,0,1),(455,2,1,3,NULL,'','test','test',0,'PostAssignment','2011-05-09 03:22:38','2011-05-13 09:57:03',NULL,NULL,NULL,NULL,1,1),(456,2,1,3,NULL,'','test attach filetest','test',0,'PostAssignment','2011-05-10 03:58:33','2011-05-12 04:35:21',NULL,NULL,NULL