khuyên Thu thi vào học ngành du lịch tại tỉnh. Cô không phụ lòng của họ, đỗ cao đẳng với số điểm tương đối.</p><table width=\"1\" align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\"><tbody><tr><td><p align=\"center\"><img src=\"http://ngoisao.net/news/hinh-su/2011/04/165237-trai-long-cua-hoa-hau-ma-tuy/Thu.jpg\" alt=\"Thu mong sẽ bắt đầu lại cuộc sống từ chính nơi mình đã vấp váp.\" height=\"497\" hspace=\"0\" vspace=\"0\" width=\"350\" align=\"center\" border=\"1\"></p></td></tr><tr><td class=\"Image\" style=\"font-size: 9pt; color: rgb(76, 76, 76); font-family: Arial; text-decoration: none;\">Thu mong sẽ bắt đầu lại cuộc sống từ chính nơi mình đã vấp váp.</td></tr></tbody></table><p class=\"Normal\" style=\"font-size: 11pt; color: rgb(0, 0, 0); font-family: \'Times New Roman\'; line-height: 19px;\" align=\"left\">Ba năm trôi qua thật nhanh và Thu cũng đã tốt nghiệp với tấm bằng khá trong tay. Ngay năm đó, Thu ôn thi tiếp và đỗ vào khoa Công nghệ Thông tin của một trường Đại học ở Hà Nội. “Mẹ em đã dặn dò thật nhiều khi em lên Hà Nội học. Lúc ấy, em đã bướng bỉnh bảo rằng mình đã lớn, có thể trải qua được những khó khăn của một sinh viên xa nhà. Bây giờ em mới biết, lời của bố mẹ luôn luôn đúng”, Thu vân vê tay áo, khi nói đến quá khứ.</p></span></span>',7,'share','2011-04-19 02:10:20','2011-06-15 04:29:40'),(384,2,'hello updat','hi friend',1,'share','2011-05-05 08:30:51','2011-06-17 08:34:13'),(385,1,'test','tes',0,'share','2011-06-28 04:34:39','2011-06-28 04:34:39'),(386,1,'asdfsdf','sdfasf',0,'share','2011-06-28 04:35:25','2011-06-28 04:35:25'),(387,1,'test','test',0,'share','2011-06-28 04:35:43','2011-06-28 04:35:43'),(388,1,'dsfasf','sfasf',0,'share','2011-06-28 04:37:09','2011-06-28 04:37:09'),(389,1,'sfsdfds','sdfasdf',0,'share','2011-06-28 04:37:22','2011-06-28 04:37:22'),(390,1,'sdfasf','sfsf',1,'share','2011-06-28 04:39:06','2011-07-01 08:35:03'),(391,2,'test','test',0,'draft','2011-06-29 03:27:17','2011-06-29 03:27:17'),(392,2,'test story w