INSERT INTO `user_wall_links` VALUES (1,343,'/post_assignments/332',NULL,'test attach file test lai','tasdfasdf'),(2,344,'/post_assignments/333',NULL,'test due date','asdfasdf'),(3,350,'/post_assignments/334',NULL,'test','test'),(4,351,'/post_assignments/335',NULL,'sdfasdf','sdfasdf'),(5,352,'/post_assignments/336',NULL,'hello','hello'),(6,353,'/post_assignments/337',NULL,'bye bye','bye bye'),(7,357,'/users/2/stories/381',NULL,'toi la ai',''),(8,358,'/users/2/stories/382',NULL,'toi la ai?','toi la toi'),(9,359,'/users/2/stories/383',NULL,'Hoa hau ma tuy','<span class=\"Apple-style-span\" style=\"border-collapse: separate; color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; font-size: medium;\"><span class=\"Apple-style-span\" style=\"border-collapse: collapse;\"><p class=\"Normal\" style=\"font-size: 11pt; color: rgb(0, 0, 0); font-family: \'Times New Roman\'; line-height: 19px;\" align=\"left\">Thu càng lớn càng xinh xắn và là niềm tự hào lớn lao của bố mẹ. Tốt nghiệp cấp ba, với dáng người dong dỏng, gương mặt sáng, cô được gia đình hướng vào ngành du lịch. Muốn con ở gần để có thời gian chăm sóc, quan tâm bố mẹ đã khuyên Thu thi vào học ngành du lịch tại tỉnh. Cô không phụ lòng của họ, đỗ cao đẳng với số điểm tương đối.</p><table width=\"1\" align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\"><tbody><tr><td><p align=\"center\"><img src=\"http://ngoisao.net/news/hinh-su/2011/04/165237-trai-long-cua-hoa-hau-ma-tuy/Thu.jpg\" alt=\"Thu mong sẽ bắt đầu lại cuộc sống từ chính nơi mình đã vấp váp.\" height=\"497\" hspace=\"0\" vspace=\"0\" width=\"350\" align=\"center\" border=\"1\"></p></td></tr><tr><td class=\"Image\" style=\"font-size: 9pt; color: rgb(76, 76, 76); font-family: Arial; text-decoration: none;\">Thu mong sẽ bắt đầu lại cuộc sống từ chính nơi mình đã vấp váp.</td></tr></tbody></table><p class=\"Normal\" style=\"font-size: 11pt; color: rgb(0, 0, 0); font-family: \'Times New Roman\'; line-height: 19px;\" align=\"left\">Ba năm trôi qua thật nhanh và Thu cũng đã tốt nghiệp với tấm bằng khá trong tay. Ngay năm đó, Thu ôn thi tiếp và đỗ vào khoa Công nghệ Thông tin của một trường Đại học ở Hà Nội. “Mẹ em đã dặn dò thật nhiều khi em lên Hà Nội học. Lúc ấy, em đã bướng bỉnh bảo rằng mình đã lớn, có thể trải qua được những khó khăn của một sinh viên xa nhà. Bây giờ em mới biết, lời của bố mẹ luôn luôn đúng”, Thu vân vê tay áo, khi nói đến quá khứ.</p></span></span>'),(10,362,'/post_qas/341',NULL,'asdfasdfasdfasdf','sdfasdfasf'),(11,363,'/post_myxes/343',NULL,'asdfasdf','asdfasdfasdf'),(12,422,'/post_assignments/344',NULL,'test attach file test lai','test'),(13,423,'/post_assignments/346',NULL,'test with tag','test with tag'),(14,424,'/post_assignments/347',NULL,'test due date','test'),(15,425,'/post_assignments/350',NULL,'test attach file test lai','test attach file test lai'),(16,426,'/post_assignments/359',NULL,'test attach file test lai','sdfasfsdfsadf'),(17,427,'/post_assignments/360',NULL,'sdfasdfasf','asfasfasdf'),(18,428,'/post_teamups/362',NULL,'tewst','tasdfsd'),(19,429,'/post_assignments/364',NULL,'sdfasdfdsf','asdfasf'),(20,430,'/post_assignments/365',NULL,'asdfasdfsdafa','asdfasdf'),(21,431,'/post_projects/366',NULL,'test attach file test lai','stest'),(22,432,'/post_projects/367',NULL,'Khong co duedate','asdfasdfds'),(23,433,'/post_projects/368',NULL,'co attach file','co attach file'),(24,434,'/post_assignments/372',NULL,'asdfasdfsdafa','asdfasdfsdf'),(25,435,'/post_projects/374',NULL,'asdfasdfasdfasdf','asdfasdfasdfasdf'),(26,436,'/post_projects/375',NULL,'sdSASDFASDF','ASDFASDFasdf'),(27,438,'/post_tutors/398',NULL,'asfasdf','asdfasdf'),(28,439,'/post_myxes/405',NULL,'sdfasdfasdfasdf','asdfasdfsdf'),(29,440,'/post_teamups/411',NULL,'asdfasdfasdfasdf','asdfasdf'),(30,441,'/post_projects/416',NULL,'asdfasdfasdfasdf','asdfasdfasdf'),(31,442,'/post_projects/417',NULL,'asdfdasfasdfasdfasdfasdf','asdfasdfasdf'),(32,443,'/post_projects/418',NULL,'sdsadf','asdfasdf'),(33,444,'/post_projects/422',NULL,'sdfsdfasdf','asdfasdfasdf'),(34,445,'/post_qas/428',NULL,'\'Lạm phát cao hơn vì kỳ vọng của người dân\'Điều đáng quan tâm là trong dân chúng luôn thường trực tâm lý kỳ vọng giá còn tăng cao hơn nữa, đặc biệt là khi nền kinh tế đối mặt với lạm phát. Trong lĩnh vực tiền tệ, do lo sợ mất giá, những người có tiền đồng','Điều đáng quan tâm là trong dân chúng luôn thường trực tâm lý kỳ vọng giá còn tăng cao hơn nữa, đặc biệt là khi nền kinh tế đối mặt với lạm phát. Trong lĩnh vực tiền tệ, do lo sợ mất giá, những người có tiền đồng trong tay lại chuyển hóa tích trữ sang các dạng tài sản khác như vàng hay đôla Mỹ, tỷ giá đồng Việt Nam và đôla Mỹ vì thế càng chịu sức ép nhiều hơn. Cùng lúc đó, người có hàng hóa như nông dân cũng mong hàng hóa của mình sẽ còn được giá hơn. Một vòng xoay luẩn quẩn là giá càng cao, người ta càng kỳ vọng nó còn cao hơn nữa. Giá lương thực tăng cao sẽ khiến lạm phát tăng cao hơn.'),(35,446,'/post_qas/429',NULL,'\'Lạm phát cao hơn vì kỳ vọng của người dân\'Điều đáng quan tâm là trong dân chúng luôn thường trực tâm lý kỳ vọng giá còn tăng cao hơn nữa, đặc biệt là khi nền kinh tế đối mặt với lạm phát. Trong lĩnh vực tiền tệ, do lo sợ mất giá, những người có tiền đồng','test'),(36,463,'/post_teamups/23',NULL,'test attach file test lai','test'),(37,464,'/users/2/stories/384',NULL,'hello','hi friend'),(38,467,'/post_assignments/26',NULL,'test attach file test lai','test'),(39,468,'/post_assignments/27',NULL,'EXIMBANK RA MẮT THẺ EXIMBANK -VISA PLATINUM','Nhằm đáp ứng các nhu cầu ngày càng cao của các doanh nhân, nhà quản lý cấp cao, ngày 06/05/2011 Eximbank đã triển khai sản phẩm thẻ Eximbank-Visa Platinum, dòng sản phẩm cao cấp với các tính năng thanh toán vượt trội cùng với nhiều tiện ích và ưu đãi dành'),(40,469,'/post_assignments/28',NULL,'test eximbank','test eximbank'),(41,470,'/post_assignments/29',NULL,'test','test'),(42,471,'/post_assignments/30',NULL,'test','test'),(43,472,'/post_assignments/35',NULL,'test','test'),(44,473,'/post_assignments/36',NULL,'test 1','test 1'),(45,474,'/post_assignments/37',NULL,'hello','hello'),(46,475,'/post_assignments/38',NULL,'408 tỷ đồng điều tra tổng thể quặng bô xít, laterit miền Nam','Theo đó, đề án xác định phát hiện và khoanh định các diện tích có quặng bô xít, quặng sắt letarit trong vỏ phong hóa bazan; dự tính và dự báo tài nguyên của các loại khoáng sản này đồng thời nghiên cứu mẫu công nghệ thử nghiệm luyện gang từ quặng sắt laterit làm cơ sở đánh giá khả năng thu hồi quặng và hiệu quả kinh tế.\r\n\r\nDự án sẽ điều tra trên diện tích hơn 14.000 km2 tại 7 vùng, phân bố ở các tỉnh Kon Tum, Gia Lai, Bình Định, Đăk Lăk, Đăk Nông, Bình Phước, Bình Thuận, Lâm Đồng và Đồng Nai, thời gian dự kiến từ tháng 10/2011 đến tháng 9/2015.\r\n\r\nHiện, mới có hơn 2.488 km2 được thăm dò theo quy hoạch. Phần diện tích còn lại được điều tra sơ lược và dự báo tài nguyên.'),(47,484,'/post_assignments/47',NULL,'test','test'),(48,485,'/post_assignments/48',NULL,'This is the VOA Special English Economics Report.','The job market is more competitive than ever for millions of workers around the world. In...'),(49,486,'/post_assignments/48',NULL,'test attach filetest','test'),(50,525,'/post_tutors/22',NULL,'test','test'),(51,526,'/post_assignments/49',NULL,'test with tag','test with tag'),(52,527,'/post_qas/24',NULL,'test with tag','test with tag'),(53,528,'/post_myxes/478',NULL,'hello','hello'),(54,529,'/post_assignments/31',NULL,'hello','hello'),(55,530,'/post_assignments/50',NULL,'test due date','test due date'),(56,531,'/post_assignments/32',NULL,'test due date','test due date'),(57,532,'/post_assignments/51',NULL,'Post from assigment','Post from assigment'),(58,533,'/post_projects/30',NULL,'teset from 